define(function(require,exports,module){require("lib/datepicker/js/bootstrap-datetimepicker");module.exports={init:function(){for(var t=$("input[data-date-format]"),e=0;e<t.length;e++){var a=$(t[e]),n=a.attr("id");$("#"+n).datetimepicker({autoclose:!0,todayBtn:!0,weekStart:1,todayHighlight:!0})}},getToday:function(){var t=new Date,e=t.getFullYear(),a=t.getMonth()+1,n=t.getDate()+1;t.getHours(),t.getMinutes(),t.getSeconds();return e+"-"+a+"-"+n},getLastWeek:function(){var t=new Date,e=new Date(t.getTime()-6048e5),a=e.getFullYear(),n=e.getMonth()+1,r=e.getDate();e.getHours(),e.getMinutes(),e.getSeconds();return a+"-"+n+"-"+r},getDays:function(t,e){var a,n;a=t.split("-"),n=e.split("-");var r=new Date(a[0],a[1]-1,a[2]),i=new Date(n[0],n[1]-1,n[2]);return parseInt(Math.abs(r-i)/1e3/60/60/24)}}});